// Import
import React from "react";

// Functional Component
const ErrorPage = () => {
    return(
        <div>
            <p id="error-title">Sorry, something went wrong.</p>
            <p id="error-message">We apologize for the inconvenience, please try again later or contact our customer service team for assistance.</p>
            <img id="error-image" src="https://f1rstmotors.com/wp-content/uploads/2022/12/error-car.jpg" alt="error image" />
            <button id="error-button">Go back to homepage</button>
        </div>
    )
};

// Export
export default ErrorPage;


// Rememeber IDs(#) are more specific than Classes(.)
